import styled from "styled-components";

export const Container = styled.div`
  float: left;
  margin: 0;
`;

export const ListItems = styled.div`
  display: block;
  padding: 5px 0;
`;

export const H3 = styled.h3`
  float: left;
  margin-top: 5px;
  padding: 0;
`;

export const Icon = styled.div`
  display: inline;
  clear: left;
//   float: right;
`;
